import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const CheckoutScreen = () => {
  return (
    <View>
      <Text>CheckoutScreen</Text>
    </View>
  )
}

export default CheckoutScreen

const styles = StyleSheet.create({})
